dns:
    enable: true
    prefer-h3: true
    ipv6-timeout: 100
    use-hosts: true
    use-system-hosts: true
    respect-rules: true
    nameserver:
        - system
        - https://223.5.5.5/dns-query
        - https://doh.pub/dns-query
    fallback-filter:
        geoip: true
        geoip-code: CN
    enhanced-mode: fake-ip
    fake-ip-range: 28.0.0.1/8
    fake-ip-filter:
        - dns.msftnsci.com
        - www.msftnsci.com
        - www.msftconnecttest.com
    default-nameserver:
        - 114.114.114.114
        - 223.5.5.5
        - 8.8.8.8
        - 1.0.0.1
    proxy-server-nameserver:
        - https://223.5.5.5/dns-query
        - https://doh.pub/dns-query
ntp:
    server: time.apple.com
    port: 123
    interval: 30
tun:
    dns-hijack:
        - 0.0.0.0:53
    auto-route: true
    auto-detect-interface: true
    inet6-address:
        - fdfe:dcba:9876::1/126
tuic-server:
    max-idle-time: 15000
    authentication-timeout: 1000
    alpn:
        - h3
    max-udp-relay-packet-size: 1500
iptables:
    inbound-interface: lo
    dns-redirect: true
experimental:
    quic-go-disable-ecn: true
profile:
    store-selected: true
    store-fake-ip: true
geox-url:
    geoip: https://github.com/MetaCubeX/meta-rules-dat/releases/download/latest/geoip.dat
